INSERT INTO `selecao_edital` VALUES (1,'EDITAL DE PROCESSO SELETIVO PARA CURSO DE TÉCNICO EM ENFERMAGEM','OUT','2022','2022-10-24','2022-10-26','2022-11-06','2022-12-13',0,'2022-10-18 23:23:21.080547','A Secretaria Municipal de Educação da Prefeitura de Nova Friburgo publicou no último sábado, 15, no Diário Oficial Eletrônico, o edital do processo seletivo para o curso técnico em enfermagem da Escola de Auxiliares e Técnicos de Enfermagem Nossa Senhora de Fátima. As inscrições podem ser feitas nesta plataforma a partir da próxima segunda-feira, 24, até o dia 26. O candidato deverá ter ensino médio completo no ato da matrícula.\r\n\r\nSerá aplicada prova discursiva, presencial, no dia 6 de novembro, de caráter eliminatório e classificatório, constituída de uma redação (dissertativo-argumentativa) sobre tema da atualidade ligado à área da Saúde, com duração de 1 hora e 30 minutos. O local e o horário do processo seletivo serão divulgados no dia 1º de novembro de 2022, no Diário Oficial do Município e também nesta plataforma.\r\n\r\nSerão convocados para matrícula os 30  primeiros colocados, em conformidade com a distribuição de vagas para ampla concorrência e vagas reservadas, conforme consta no edital. Os resultados da seleção serão publicados no dia 13 de dezembro.','https://plenussistemas.dioenet.com.br/uploads/view/12745','https://drive.google.com/file/d/1I65D5y0GtGsUljLV9CzIsbkic-ZdNabe/view?usp=sharing','2022-11-01',NULL,30,15),(2,'EDITAL DE PROCESSO SELETIVO PARA CURSO DE TÉCNICO EM ENFERMAGEM','SET','2023','2023-10-02','2023-10-04','2023-10-22','2023-12-05',1,'2023-09-21 15:29:56.332752','A Secretaria Municipal de Educação da Prefeitura de Nova Friburgo publicou na última 4ª feira, dia 20 de setembro, no Diário Oficial Eletrônico, o edital do processo seletivo para o curso técnico em enfermagem da Escola de Auxiliares e Técnicos de Enfermagem Nossa Senhora de Fátima. \r\n\r\nAs inscrições deverão ser feitas nesta plataforma, a partir do dia 02 de outubro até o dia 04 de outubro de 2023.\r\n\r\nO candidato deverá ter ensino médio completo no ato da matrícula.\r\n\r\nSerá aplicada prova discursiva, presencial, no dia 22 de outubro de 2023, de caráter eliminatório e classificatório, constituída de uma redação (dissertativo-argumentativa) sobre tema da atualidade ligado à área da Saúde, com duração de 1 hora e 30 minutos. \r\n\r\nO local e o horário do processo seletivo serão divulgados no dia 17 de outubro de 2023, no Diário Oficial do Município e também nesta plataforma.\r\n\r\nSerão convocados para matrícula os 30  primeiros colocados, em conformidade com a distribuição de vagas para ampla concorrência e vagas reservadas, conforme consta no edital. \r\n\r\nOs resultados da seleção serão publicados no dia 05 de dezembro de 2023 no Diário Oficial do Município e também nesta plataforma.','https://plenussistemas.dioenet.com.br/uploads/view/19241','https://drive.google.com/file/d/1rTnfARR-qhbRQ_WmRUf_luVHvnaK2hdF/view?usp=sharing','2023-10-17',NULL,30,10),(3,'EDITAL DE PROCESSO SELETIVO PARA CURSO DE TÉCNICO EM ENFERMAGEM','OUT','2024','2024-10-08','2024-10-11','2024-10-20','2024-12-03',1,'2024-09-19 18:06:13.204065','A Secretaria Municipal de Educação da Prefeitura de Nova Friburgo publicou na 5ª feira, dia 19 de setembro, no Diário Oficial Eletrônico, o edital do processo seletivo para o curso técnico em enfermagem da Escola de Auxiliares e Técnicos de Enfermagem Nossa Senhora de Fátima. \r\n\r\nAs inscrições deverão ser feitas nesta plataforma, a partir do dia 08 de outubro até o dia 11 de outubro de 2024.\r\n\r\nO candidato deverá ter ensino médio completo no ato da matrícula.\r\n\r\nSerá aplicada prova discursiva, presencial, no dia 20 de outubro de 2024, de caráter eliminatório e classificatório, constituída de uma redação (dissertativo-argumentativa) sobre tema da atualidade ligado à área da Saúde, com duração de 1 hora e 30 minutos. \r\n\r\nO local e o horário do processo seletivo serão divulgados no dia 16 de outubro de 2024, no Diário Oficial do Município e também nesta plataforma.\r\n\r\nSerão convocados para matrícula os 30  primeiros colocados, em conformidade com a distribuição de vagas para ampla concorrência e vagas reservadas, conforme consta no edital. \r\n\r\nOs resultados da seleção serão publicados no dia 03 de dezembro de 2024 no Diário Oficial do Município e também nesta plataforma.\r\n\r\nAs informações prestadas no formulário de inscrição são de inteira\r\nresponsabilidade do candidato, reservando-se à Comissão o direito de excluir do\r\nProcesso Seletivo Público aquele que não preencher esse documento oficial de forma\r\ncompleta e correta, e/ou fornecer dados inverídicos ou falsos.','https://plenussistemas.dioenet.com.br/uploads/view/24006?utm_edicao=2100','https://drive.google.com/file/d/16act-vmjMv8__CE4MIBYaM_K_6MSizG_/view?usp=sharing','2024-10-16',NULL,30,10),(7,'Teste','AGO','2025','2025-08-28','2025-09-28','2025-11-28','2025-12-28',1,'2025-08-28 19:08:11.711635','.','https://enfermagem.pmnf.rj.gov.br/',NULL,'2025-10-28',NULL,2,2);
